import React from "react";

function Task({ index, task }) {
  console.log("Task", index, task);
  return (
    <div>
      <h1>Task</h1>
      {task.map(([key, value]) => {
        return (
          <div key={key}>
            <h3>{key}</h3>
            <p>{value}</p>
          </div>
        );
      })}
    </div>
  );
}

export default Task;
